import { Row } from "antd";
import { withTranslation } from "react-i18next";
import LeftContentBlock from "../ContentBlock/LeftContentBlock";
import RightContentBlock from "../ContentBlock/RightContentBlock";

import {
  GenContainer,
  BlockContainer,
  ContentWrapperTitle,
  ContentTitle,
} from "./styles";

const History = () => {

  return (
    <GenContainer>
      <BlockContainer>
          <Row justify="center" align="middle">
            <ContentWrapperTitle>
                <h1>What's in a mint?</h1>
                <ContentTitle>The Okto project is a gateway to a future bigger project. So who does he have in the mint?</ContentTitle>
            </ContentWrapperTitle>
          </Row>

        <LeftContentBlock 
          title=""
          content="1x Unique Okto NFT stored on Solana"
          icon="graphs.svg"
          direction="up"
        />

        <RightContentBlock
          title=""
          content="1x Pass for multiple prize in SOL"
          icon="product-launch.svg"
          direction="up"
        />

        <LeftContentBlock
          title=""
          content="1x Wallet address whitelist for the futur collection and project"
          icon="waving.svg"
          direction="up"
        />
      </BlockContainer>
    </GenContainer>
  );
};

export default withTranslation()(History);
